import Head from "next/head";

export default function App() {
  return (
    <>
      <Head>
        <title>Test Fulogy</title>
        {/* <link rel="icon" href="/favicon.ico" /> */}
      </Head>
      <main>
        <h1 className="hidden">Форма</h1>
      </main>

      <style jsx global>
        {`
          .hidden {
            color: red;
          }
        `}
      </style>
    </>
  );
}
